import Fisico1 from '../img/fisico1.png';
import Digital1 from '../img/digital1.png';

export function CardConfig () {
    return [
        {Titulo: 'Convite de casamento',Texto: 'R$ 3,00 Un.', Img: {Fisico1}},
        {Titulo: 'Convite digital',Texto: 'R$ 25,00 Un.', Img: {Digital1}},
    ];
}
